import "./App.css";
import Dashboard from "./components/Dashboard";

function App() {
  let walletBalance = 5000;

  return (
    <div className="App">
      <h1 style={{color:"#fff"}}>Expense Tracker</h1>
      <Dashboard walletBalance={walletBalance} />
    </div>
  );
}

export default App;
